{"settings":"{
    "git.autofetch": true,
    "settingsSync.ignoredExtensions": [

    ],
    "settingsSync.ignoredSettings": [],
    "git.openRepositoryInParentFolders": "always",
    "security.workspace.trust.untrustedFiles": "open",
    "explorer.confirmDelete": false,
    "terminal.external.osxExec": "Wezterm.app",
    "terminal.integrated.shellIntegration.enabled": false,
    "terminal.integrated.profiles.osx": {
        "bash": {
            "path": "bash",
            "args": [
                "-l"
            ],
            "icon": "terminal-bash"
        },
        "zsh": {
            "path": "zsh",
            "args": [
                "-l"
            ]
        },
        "fish": {
            "path": "fish",
            "args": [
                "-l"
            ]
        },
        "tmux": {
            "path": "tmux",
            "icon": "terminal-tmux"
        },
        "pwsh": {
            "path": "pwsh",
            "icon": "terminal-powershell"
        },
        "fish (2)": {
            "path": "/opt/homebrew/bin/fish"
        }
    },
    "terminal.integrated.defaultProfile.osx": "fish (2)",
    "workbench.colorTheme": "Fluffy Theme",
    "workbench.iconTheme": "vscode-celestial-magic-girl-icon-theme",
    "editor.fontLigatures": true,
    "editor.fontFamily": "\"0xProto Nerd Font Mono\"",
    "vscode-pets.petColor": "magical",
    "vscode-pets.throwBallWithMouse": true,
    "vscode-pets.petSize": "medium",
    "workbench.editor.enablePreview": false,
    "files.trimTrailingWhitespace": true,
    "terminal.integrated.fontFamily": "\"0xProto Nerd Font Mono\"",
    "terminal.integrated.fontSize": 14,
    "editor.fontSize": 16,
    "[ruby]": {
        "editor.defaultFormatter": "Shopify.ruby-lsp",
        "editor.formatOnSave": true,
        "editor.tabSize": 2,
        "editor.insertSpaces": true,
        "editor.semanticHighlighting.enabled": true,
        "editor.formatOnType": true,
        "editor.wordSeparators": "`~@#$%^&*()-=+[{]}\\|;:'\",.<>/"
    }
}"}
